from typing import List
import collections
import time

class Solution:
    def maxDistance(self, grid: List[List[int]]) -> int:
        length = len(grid)
        # distances = []
        def neighbor(i,j):
            x = [0, 0, 1, -1]
            y = [-1, 1, 0, 0]
            for d in range(4):
                if 0 <= i + x[d] < length and 0 <= j + y[d] < length:
                    yield (i+x[d], j+y[d])
        
        def bfs(i, j):
            history = [[0] * 101 for _ in range(101)]
            q = collections.deque()
            q.append((i, j, 0))
            # print(distances)
            while q:
                x, y, count = q.pop()
                for i, j in neighbor(x, y):
                    if grid[i][j] == 1:
                        return count + 1
                    # if not (i, j) in history:
                    if history[i][j] == 0:
                        q.appendleft((i, j, count + 1))
                        # history.add((i, j))
                        history[i][j] = 1
            return -1
        ans = -1
        for i in range(length):
            for j in range(length):
                if grid[i][j] == 0:
                    ans = max(ans, bfs(i,j))
        return ans

class Solution1:
    def maxDistance(self, grid: List[List[int]]) -> int:
        ans = -1
        length = len(grid)
        def neighbor(i,j):
            x = [0, 0, 1, -1]
            y = [-1, 1, 0, 0]
            for d in range(4):
                if 0 <= i + x[d] < length and 0 <= j + y[d] < length:
                    yield (i+x[d], j+y[d])
        flag = True
        q = collections.deque()
        for i in range(length):
                for j in range(length):
                    if grid[i][j] == 1:
                        # q.appendleft((i, j))
                        for x, y in neighbor(i, j):
                            if grid[x][y] == 0:
                                q.appendleft((x, y))
                                grid[x][y] = 2
        if not q:
            return -1
        ans = 0
        # print(q)
        while q:
            # print(q)
            tmpLen = len(q)
            for _ in range(tmpLen):
                i, j = q.pop()
                for x, y in neighbor(i, j):
                    if grid[x][y] == 0:
                        q.appendleft((x, y))
                        grid[x][y] = 1
            ans += 1
            
        return ans


